import './App.css';

function App() {
  const expenses = [
    {
      title : 'Car Insurance costs',
      amount : '$213.24',
      date : new Date('2023-01-02 00:00:00')
    },
    {
      title : 'Subway costs',
      amount : '$10.21',
      date : new Date(2022,12,12)
    },
    {
      title : 'food buying',
      amount : '$300.1',
      date : new Date(2022,12,11)
    },
    {
      title : 'building repairing',
      amount : '$250',
      date : new Date(2022,11,10)
    }
  ];

  return (
    <div>
      <h2>Let's get Started</h2>

    </div>
  );
}

export default App;
